import React from 'react';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Detail from './pages/Detail';
import Home from './pages/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import Result from './pages/Result';
import Ajout from './pages/Ajout';
import Navigation from './components/Navigation';
import Modifier from './pages/Modifier';
import DocumentAValider from './pages/DocumentAValider'; 
import Attestation from './pages/Attestation';
import TemplateAdmin from './components/TemplateAdmin';


const App = () => {
  return (

    <BrowserRouter>
    <div className="Result" >
            <h1>Archive de document</h1>
            <div className="container">
                <div className="row">

                   <Navigation/>


                    <div className=" border border-primary rounded col-10">
                    <Routes>
                        <Route path="/" element={<Home/>}/>
                        <Route path="/Detail" element={<Detail/>}/>
                        <Route path="/Result" element={<Result/>}/>
                        <Route path="/Ajout" element={<Ajout/>}/>
                        <Route path="/Modifier/:id" element={<Modifier/>}/>
                        <Route path="/Attestation/:id" element={<Attestation/>}/>
                        <Route path="/DocumentAValider" element={<DocumentAValider/>}/>
                        <Route path="/TemplateAdmin" element={<TemplateAdmin/>}/>
                    </Routes>


                    </div>
                </div>
                </div>
             </div>

    </BrowserRouter>
  );
};

export default App;
